import React from 'react';
import PropTypes from 'prop-types';

import '../../style/main.scss';


const Page = ({ children }) => (
  <div className="page">
    <div className="content">
      { children }
    </div>
  </div>
);

Page.propTypes = {
  children: PropTypes.node,
  title: PropTypes.string,
};

Page.defaultProps = {
  children: null,
};

export default Page;
